    </div>
    <button id="upload">上传图片</button>
    <canvas id="canvas" width="800" height="800"></canvas>
    <img src="" class="generateImg">
    <button id="download">下载</button>
    <input type="file" accept="image/*" hidden>
</div>

<script>
    const ul = document.querySelector('ul')
    const img = document.querySelectorAll('ul img')
    for (let imgElement of img) {
        imgElement.setAttribute("crossOrigin",'Anonymous')
    }
    const upload = document.querySelector('#upload')
    const download = document.querySelector('#download')
    const canvas = document.querySelector('#canvas')
    const ctx = canvas.getContext('2d')
    const generateImg = document.querySelector('.generateImg')
    const fileUpload = document.querySelector('input')
    let upLoadImg
    let avatarIcon


    // 画canvas
    function drawImage(img) {
        ctx.drawImage(img, 0, 0, 800, 800)
    }

    // 清空canvas
    function resetCanvas() {
        ctx.clearRect(0, 0, canvas.width, canvas.height)
        ctx.fillStyle = 'rgba(255, 255, 255, 0)'
    }

    function canvasToImg() {
        generateImg.src = canvas.toDataURL("image/png")
    }

    // 点击icon
    ul.addEventListener('click', function (event) {
        if (event.target.nodeName.toLowerCase() === 'img') {
            resetCanvas()
            upLoadImg && drawImage(upLoadImg)
            drawImage(event.target)
            canvasToImg()
            avatarIcon = event.target
        }
    })
    // 上传图片
    upload.addEventListener('click', function () {
        fileUpload.click()
    })
    // 监听文件变化
    fileUpload.addEventListener('change', function () {
        const img = new Image()
        img.src = URL.createObjectURL(this.files[0])
        img.onload = function () {
            drawImage(img)
            drawImage(avatarIcon)
            canvasToImg()
            upLoadImg = img
        }
    })
    // 默认是第一张
    img[0].onload = function () {
        drawImage(img[0])
        avatarIcon = img[0]
        canvasToImg()
    }

    function dataURLtoBlob(dataurl) {
        var arr = dataurl.split(','), mime = arr[0].match(/:(.*?);/)[1],
            bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
        while (n--) {
            u8arr[n] = bstr.charCodeAt(n);
        }
        return new Blob([u8arr], { type: mime });
    }

    function downloadFile(url,name){
        var a = document.createElement("a") //新建一个a链接
        a.setAttribute("href",url) // a链接的url为图片的url
        a.setAttribute("download",name)
        a.setAttribute("target","_blank")
        let clickEvent = document.createEvent("MouseEvents");
        clickEvent.initEvent("click", true, true);
        a.dispatchEvent(clickEvent);
    }

    // 73so.com
    function downloadFileByBase64(base64,name){
        var myBlob = dataURLtoBlob(base64);
        var myUrl = URL.createObjectURL(myBlob); //创建图片的临时url
        downloadFile(myUrl,name)
    }

    // 下载图片
    download.addEventListener('click', function () {
        var name = new Date().getTime(); //自定义图片名称
        downloadFileByBase64(generateImg.src,name);
    })
</script>
</body>
